export default function Burgers() {

  const { burgers } = useSnack()
  return (
    <>
      <Head title="Hambúrgueres" />
      <SnackTitle>Hambúrgueres</SnackTitle>
      <Snacks snacks={burgers}></Snacks>
    </>
  );
}
